// frontend/src/components/History.js
import React from 'react';
import './History.css';

const History = ({ instrument }) => {
    if (!instrument) {
        return <div>No hay informaci√≥n disponible sobre el instrumento.</div>;
    }

    return (
        <div className="history">
            <h2>{instrument.name}</h2>
            <p>{instrument.history}</p>
            {instrument.imageUrl && <img src={instrument.imageUrl} alt={instrument.name} />}
        </div>
    );
};

export default History;
